#selected-char-list, #banned-char-list  {
  margin: 0;
  overflow: none;
  box-sizing: border-box;
  display: flex;
  flex-flow: row no-wrap;
  justify-content:center;
  box-sizing: border-box;
  display: flex;
  flex-flow: row wrap;
  align-items: flex-start;
  align-content: space-between;
}
#banned-char-list .char-img {
  width: 100px; 
  background-image: url("data:image/svg+xml,%3Csvg width='100%' height='100%' viewBox='0 0 128 128' fill='grey' xmlns='http://www.w3.org/2000/svg'%3E%3Ccircle r='46' cy='16' cx='0' stroke='grey' stroke-width='4' fill='none' transform='translate(64, 64)'/%3E%3C/svg%3E");
}
#selected-char-list .char-img {
  margin: 1px;
  border-radius: 5px;
  background-size: 100% 100%;
  width: 78px;
}
#result-char-list {
  overflow: hidden;
  display: grid;
  grid-template-columns: repeat(8, 1fr);
}
#result-char-list .char-img {
  margin: 1px;
  border-radius: 5px;
  background-size: 100% 100%;
  width: 66px;
}

  <script>
avatars = fetch("static/genshin-latest.json")
.then(response => response.json())
.then(responseJson => {
  responseJson.map(e => draw(e))
})

function draw(char) {
  if ("content" in document.createElement("template")) {
    var template = document.querySelector("#char-template");
    var clone = document.importNode(template.content, true);
    var charDiv = clone.querySelector(".char")
    clone.querySelector(".char-img").src = char.img
    charDiv.setAttribute("id", char.id) 
    charDiv.setAttribute("quality", char.quality) 
    charDiv.setAttribute("weaponType", char.weaponType) 
    charDiv.setAttribute("status", "selected") 
    charDiv.addEventListener('click', toggleBan)
    document.querySelector("#selected-char-list").appendChild(clone)
  }
  else {
    // Buy yourself a browser... because it is not supposed to be handled anytime soon ;)
  }
}
function roll() {
  chars = document.querySelectorAll("#selected-char-list .char")
  r = (Math.random() * chars.length).toFixed(0)
  selectedChars = document.querySelector("#result-char-list")
  selectedChars.appendChild(chars[r])
  console.log({r: r, chars: chars[r]})
}

function toggleBan() {
  const status = this.getAttribute("status") === "selected" ? "banned" : "selected"
  this.querySelector('.char-img').src = status === "selected" ? 
    this.querySelector('.char-img').src.replace('side_icon/UI_AvatarIcon_Side_', 'icon/UI_AvatarIcon_') :
    this.querySelector('.char-img').src.replace('icon/UI_AvatarIcon_', 'side_icon/UI_AvatarIcon_Side_')  
  this.setAttribute("status", status)
  document.querySelector(`#${status}-char-list`).appendChild(this)
}

  </script>
